{{Landmark Item Complement (bottom)}}

{{Landmark Item}}
{{Landmark Item Complement (intro)}}
{{Landmark Item Complement (top)}}

L''''outil soigner''' permet de régénérer une zone de terrain telle qu'elle était à l'origine, avant que le joueur ne commence à la modifier.

En appliquant cet outil à une zone, tous les matériaux rajoutés précédemment par le joueur dans cette zone sont restitués.

Comme presque tous les [[outils de construction]], il ne fonctionne pas en dehors d'un [[terrain]], et sous réserve que le joueur possède des droits suffisants.

L''''Outil soigner''' fait parti des [[Outils de construction]] de base fournis dès la création du personnage.

== Notes de version ==
Dans les premières version du jeu, '''{{PAGENAME}}''' faisait parti des [[Outils de construction]] de base. Depuis la mise à jour du 8 mai 2015, il s'acquiert en suivant le tutoriel du jeu.

