{{Landmark Item}} {{Landmark Item Complement (intro)}}
== Inventaire == Ce coffre dispose de 15 emplacements de stockage.
L'[[inventaire]] des ''chests'' est lié au contenant et non au joueur. Aux yeux d'un joueur donné, tous les ''chests'' du jeu ont chacun un contenu différent. Cela veut également dire que le contenu d'un coffre est le même pour tous les joueurs : si deux joueurs différents regardent le même coffre, ils y trouveront la même chose.
Il est possible d'attribuer différents droits aux ''chests'' placés sur un terrain. Tous les ''chests'' d'un même terrain partagent les mêmes droits. * Droit "Visitor" : les autres joueurs peuvent regarder dans le coffre et y déposer un objet, mais ne peuvent pas y prendre d'objet * Droit "Customer" : les autres joueurs peuvent regarder, déposer et prendre un objet dans le coffre
{{Landmark Item Complement (top)}}
