{{Landmark Item}} {{Landmark Item Complement (intro)}}
Elle permet la fabrication de diverses familles d'objets : * [[Adventurer's Gear (Category)|Aventurer's Gear]] (Équipement de l'aventurier) * [[Pick (Category)|Pick]] (Pioches) * [[Axe (Category)|Axe]] (Haches) * [[Sickle (Category)|Sickle]] (Faucilles) * [[Pulverizer (Category)|Pulverizer]] * [[Weapon (Category)|Weapon]] (Armes) * [[Chest Armor (Category)|Chest Armor]] * [[Head Armor (Category)|Head Armor]] * [[Hand Armor (Category)|Hand Armor]] * [[Common Block (Category)|Common Block]] * [[Metal Block (Category)|Metal Block]] * [[Smelted Metal (Category)|Smelted Metal]] * [[Crafting Component (Category)|Crafting Component]] * [[Smelter (Category)|Refining Station]] (Station de raffinage, de type "Fonderie")
En utilisant la [[Tech Forge]] plutôt que la [[Stone Forge]], on augmente les chances d'obtenir plus d'emplacements pour l'amélioration de certains objets.
