{{Landmark Item}}
{{Landmark Item Complement (intro)}}
{{Landmark Item Complement (top)}}

L''''Outil supprimer''' (''Delete Tool'') permet comme son nom l'indique de supprimer de la matière. L'utilisateur peut alterner entre une forme cubique ou une forme sphérique avec la touche [C], et faire varier la taille de ces formes en utilisant la molette de sa souris.

L''''Outil supprimer''' peut être combiné à l'[[Outil sélection]]. Il supprimera alors la sélection courante.

Supprimer de la matière restitue cette matière au joueur, qui la retrouvera dans son inventaire.

Le [[raccourcis clavier|raccourci clavier]] [Suppr] active l''''Outil supprimer''' sans avoir à le choisir dans la barre de raccourcis.

Comme presque tous les [[outils de construction]], il ne fonctionne pas en dehors d'un [[terrain]], et sous réserve que le joueur possède des droits suffisants.

== Notes de version ==
Dans les premières version du jeu, '''{{PAGENAME}}''' faisait parti des [[Outils de construction]] de base. Depuis la mise à jour du 8 mai 2015, il s'acquiert en suivant le tutoriel du jeu.

