La '''Pioche en cuivre''' (''Copper Pick'') est une [[Pick|pioche]].
{{Landmark Item Complement (top)}}
== Notes de version == {| class="wikitable" |- ! Date !! Modification apportée !! Ancienne valeur |- | 17/12/2014 || Supprimé du jeu || - |- | ??/??/2014 || Ajout au jeu || - |}
{{Landmark Item Complement (bottom)}}

{{Landmark Item}}
{{Landmark Item Complement (intro)}}

L''''Outil ajouter''' (''Add Tool'') est un [[Building Tool|outil de construction]]. Comme son nom l'indique, il permet d'ajouter de la matière. L'utilisateur peut alterner entre une forme cubique ou une forme sphérique avec la touche [C], et faire varier la taille de ces formes en utilisant la molette de sa souris.

L''''Outil ajouter''' peut être combiné à l'{{LienVo|Selection Tool}}. Il ajoutera alors de la matière à la sélection courante.

La sélection de la matière et de la texture à appliquer se fait via le menu des textures.

Ajouter de la matière consomme une partie de la ressource associée.

Contrairement aux autres [[outils de construction]], il peut s'utiliser même en dehors d'un [[terrain]]. Mais ses effets ne sont permanents que sur un terrain où le joueur possède des droits suffisants.

== Notes de version ==
Dans les premières version du jeu, '''{{PAGENAME}}''' faisait parti des [[Outils de construction]] de base. Depuis la mise à jour du 8 mai 2015, il s'acquiert en suivant le tutoriel du jeu.

