{{Landmark Item Complement (intro)}}

== Inventaire ==
Ce coffre dispose de 60 emplacements de stockage, communs à tous les ''vaults''. Ce nombre peut être augmenté.

L'[[inventaire]] des ''vaults'' est lié au joueur et non au contenant. Aux yeux d'un joueur donné, tous les ''vaults'' du jeu partagent le même contenu. Cela veut également dire que ce contenu varie d'un joueur à l'autre : si deux joueurs différents regardent le même coffre, ils n'y trouveront pas la même chose. 

