{{Landmark Item Complement (intro)}}
{{Landmark Item Complement (top)}}

L''''outil ligne''' permet de créer facilement une ligne de [[voxel]]s plus ou moins épaisse.

Comme presque tous les [[outils de construction]], il ne fonctionne qu'à l'intérieur d'un [[terrain]], et sous réserve que le joueur possède des droits suffisants.

== Notes de version ==
Dans les premières version du jeu, '''{{PAGENAME}}''' ne faisait pas parti des [[Outils de construction]] de base. Il fallait le fabriquer dans une [[forge]]  de la même façon qu'un [[objet]].  

Depuis la mise à jour du 8 mai 2015, il s'acquiert en suivant le tutoriel du jeu.

