''{{#var:name}}'' est un [[{{#var:category}}]] de type [[{{#var:subcategory}}]].

{{PAGENAME}} est un [[arbre rare]] que l'on trouve dans les [[biomes]] de type {{LienVo|Old Growth Forest}}. Il peut aussi être fabriqué en tant qu'objet de décoration et placé sur le [[terrain]] d'un joueur mais dans ce cas, il ne pourra pas être coupé à l'aide d'une [[hache]].

