Nécessite une [[hache]] d'échelon 4 ou supérieur, telle que la {{LienVo|Hache en or}}. Permet de récupérer les [[ressources]] suivantes :
* normal : {{LienVo|Burled Wood}}
* rare : {{LienVo|Ancient Rootstock}}




