Les Pulverizers permettent de rapidement détruire (sans être récoltés) la {{LienVo|Dirt}}, le {{LienVo|Sand}}, la {{LienVo|Stone}} et tout autre matériau de base, sans détruire ni récolter les [[Gemstone|Gemmes]] et [[Stone|Roches]] de niveau plus élevées. Ces dernières peuvent alors être récoltées avec une [[Pick|Pioche]] de niveau adéquat. 

