  |version= Bêta fermée
  <!-- |deleted= 1 -->
}}
{{Ébauche}}
Le '''Pile of Worked Stone''' est une [[Stone|roche]] de [[Tier 1|niveau 1]]. 
C'est la forme raffinée du {{LienVo|Stone}}.

* le {{LienVo|Tinkerer's Workshop}} donne 105 '''Pile of Worked Stone''' pour 100 unités de {{LienVo|Stone}}
* le {{LienVo|Superior Saw Table}} donne 1100 '''Pile of Worked Stone''' pour 1000 unités de {{LienVo|Stone}}
* le {{LienVo|Exceptional Saw Table}} donne 1200 '''Pile of Worked Stone''' pour 1000 unités de {{LienVo|Stone}}
* le {{LienVo|Legendary Saw Table}} donne 1300 '''Pile of Worked Stone''' pour 1000 unités de {{LienVo|Stone}}

