{{Landmark Item Complement (bottom)}}

{{Landmark Item}}

Le '''Sondeur de cavernes''' (''Cave Sounder'') est un outil très pratique pour [[explorer]] le sous-sol du jeu, puisqu'il permet de détecter les [[Cavernes|cavernes]] proches. Lorsqu'il est actif, les parois des tunnels et cavernes environnants s'affichent en surimpression verdâtre à l'écran. Il ne reste plus alors qu'à utiliser sa [[pioche]] ou mieux, son [[Pulverizer]], pour se creuser en ligne droite directement vers ces autres poches souterraines, plutôt que d'arpenter un peu au hasard le labyrinthe formé par tous ces tunnels.

{{Landmark Item Complement (intro)}}
