{{Landmark Item
|id=Tin
}}
{{Landmark Item Complement (intro)}}

L''''Étain''' (''Tin'') est un [[métal]] d'échelon 2. Sa forme naturelle commune est le {{LienVo|Minerai d'étain}}. Sa forme naturelle rare est l'{{LienVo|Étain élémentaire}}. Sa forme raffinée est le {{LienVo|Lingot d'étain}}.

{{Landmark Item Complement (top)}}

== Récolte ==
L''''Étain''' se récolte au moyen d'une {{LienVo|Pioche en cuivre}} ou supérieur.

=== Filon ===
Le filon d'étain a l'aspect d'un métal gris terne.
* On trouve souvent de l'{{LienVo|Tin}} sous un filon de {{LienVo|Fer}}. 
* On trouve parfois de la {{LienVo|Tourmaline}} sous un filon d'{{LienVo|Tin}} (quand celui-ci  ne se trouvait pas lui-même sous un filon de {{LienVo|Fer}}).
<!--* On trouve parfois l'{{LienVo|Or}} sous un filon d'{{LienVo|Amaranthine}}.-->


Un filon d'étain permet de récolter de l'Étain dans ses formes naturelles :
* Commune : {{LienVo|Minerai d'étain}}. 
* Rare : {{LienVo|Étain élémentaire}}

== Artisanat ==
{{Ask/Composant/Objets|Minerai d'étain}}
{{Ask/Composant/Objets|Étain élémentaire}}
{{Ask/Composant/Objets|Lingot d'étain}}

